import React from 'react'
import './TinderCards.css'
import {useState} from 'react'
function TinderCards() {
    const [people, setPeople] =  useState([{
        name: 'Elon Musk',
        url: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fen.wikipedia.org%2Fwiki%2FElon_Musk&psig=AOvVaw2ADWrfKAstW0JNT0wHsjRT&ust=1645538098718000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCPjErKP5kPYCFQAAAAAdAAAAABAD"
    },
    

]);
  return (
    <div className="tinderCards">
         {people.map((person) => (
             <h1>{person.name}</h1>
         ))}
    </div>
  )
}

export default TinderCards
